chapterContent.JSParser:
function functionName(config, params, result)
{
	function PrefixInteger(num, n) {
   		return (Array(n).join(0) + num).slice(-n);
	}

	let size = parseInt(result.nextPageUrl.match(/\d+/gi)[0]);
	let imgs = [];
	for(let i=1;i<=size;i++){
		let index = PrefixInteger(i,4);
		let item = result.content.replace('0001',index);
		imgs.push(item);
	}

	return imgs.join('\n');
}

