    eval(config.httpHeaders['crypto']);
    function mydecrypt(encstr) {
        let wordKey = CryptoJS.enc.Utf8.parse('cxNB23W8xzKJV26O');
        let wordIv = CryptoJS.enc.Utf8.parse('opb4x7z21vg1f3gI');
        let decrypt = CryptoJS.AES.decrypt(encstr, wordKey, {
            'iv': wordIv,
            'mode': CryptoJS.mode.CBC,
            'padding': CryptoJS.pad.Pkcs7,
        });
        return decrypt.toString(CryptoJS.enc.Utf8);
    }
    let jsvar = result.match(/chapterImages\s\=\s\"([\w+=\/]+)\";.*?chapterPath\s\=\s\"([\w\/]+)/i);
    params.nativeTool.logWithKey(jsvar, "jsvar");
    let chapterImages = jsvar[1];
    let chapterPath = jsvar[2];
    //let resHost = 'http://mangaimg.62611311.com:44240/' + chapterPath;
    let resHost = 'http://re.xzxtsm.com:45678/' + chapterPath;
    // ÊúâÈò≤ÁõóÈìæÊâÄ‰ª•ËøôÈáå‰ΩøÁî®ÂÆâÂçìappÊé•Âè£ by:Âº†ÁõäËææ

    let urls = JSON.parse(mydecrypt(chapterImages)).map(image => {
        return resHost + image;
    });
    let httpHeaders = {
        'User-Agent': 'QQMH Android Client/1.0 (qinqinmanhua@gmail.com)',
        'Referer': 'http://fenmi99.lzshengzhong.com',
    }
    return JSON.stringify({
        'urls': urls,
        'httpHeaders': httpHeaders,
    });
}

