function functionName(config, params, result) {    let list = [];    if (params.lastResponse == undefined) {        let xpath = params.nativeTool.XPathParserWithSource(result);        let res = xpath.queryWithXPath("//*[@class=\"chapter-item\"]/a");
               res.forEach((x) => {            let attr = x.attributes();            let url = attr.href.startsWith('/') ? config.host + attr.href : attr.href;            let name = x.content();            list.push({                'title': name,                'url': url,            });        });
        params.nativeTool.logWithKey(list, 'res');        list.reverse();        params.nativeTool.setCache('chapter', JSON.stringify(list));        let url = config.host + '/bookchapter/';        let queryUrl = params.queryInfo.detailUrl;        let bookid = queryUrl.substring(queryUrl.lastIndexOf('.')).match(/[0-9]+/)[0];        params.nativeTool.logWithKey(bookid, 'bookid');        let httpParams = { 'id': bookid, 'id2': '1' }        let httpHeaders = {            'User-Agent': config.httpHeaders,            'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8',            'X-Requested-With': 'XMLHttpRequest',        };        return {            httpHeaders: httpHeaders,            httpParams: httpParams,            more: true,            success: true,            autoRequestMore: true,            POST: true,            url: url,        };    } else {        let queryUrl = params.queryInfo.detailUrl;        let bookid = queryUrl.substring(queryUrl.lastIndexOf('.')).match(/[0-9]+/)[0];        let bookchapter = JSON.parse(result).map((x) => {            return {                'title': x.name,                'url': config.host + '/' + bookid + '/' + x.id+'.html',            }        });        bookchapter.reverse();        let lastchapter = JSON.parse(params.nativeTool.getCache('chapter'));        list = bookchapter.concat(lastchapter);    }    return { 'list': list };}

